import React, { useState } from 'react';

const CostCalculator = () => {
 const [brand, setBrand] = useState('');
 const [size, setSize] = useState('');
 const [unitOfMeasure, setUnitOfMeasure] = useState('bag');
 const [quantity, setQuantity] = useState(0);
 const [unitPrice, setUnitPrice] = useState(0);
 const [total, setTotal] = useState(0);

 const calculateTotal = () => {
    const unitCost = unitOfMeasure === 'bag' ? unitPrice : unitPrice * 1000;
    const totalCost = unitCost * quantity;
    setTotal(totalCost);
 };

 return (
    <div>
      <section>
        <h2>Cost Calculator</h2>
        <form>
          <label>
            Select Brand:
            <select onChange={(e) => setBrand(e.target.value)}>
              <option value="">Select</option>
              <option value="blecrown">Blecrown</option>
              <option value="ecofloat">Ecofloat</option>
              <option value="ace">Ace</option>
              <option value="aller-aqua">Aller Aqua</option>
              <option value="vital">Vital</option>
              <option value="coppens">Coppens</option>
              <option value="alpha">Alpha</option>
              <option value="ovulin">Ovulin</option>
            </select>
          </label>

          <label>
            Select Size:
            <select onChange={(e) => setSize(e.target.value)}>
              <option value="">Select</option>
              {brand === "blecrown" &&
                [2, 3, 4, 6, 9].map((size) => (
                 <option key={size} value={size}>
                    {size}mm
                 </option>
                ))}
              {brand === "ecofloat" &&
                [3, 4, 6, 9].map((size) => (
                 <option key={size} value={size}>
                    {size}mm
                 </option>
                ))}
              {brand === "ace" &&
                [3, 4, 6, 8].map((size) => (
                 <option key={size} value={size}>
                    {size}mm
                 </option>
                ))}
              {brand === "aller-aqua" &&
                [0.2, 0.4, 0.5, 0.9, 1.3, 2, 3, 4].map((size) => (
                 <option key={size} value={size}>
                    {size}mm
                 </option>
                ))}
              {brand === "vital" &&
                [2, 3, 4, 6, 9].map((size) => (
                 <option key={size} value={size}>
                    {size}mm
                 </option>
                ))}
              {brand === "coppens" &&
                [0.2, 0.3, 0.5, 0.8, 1.2, 1.5, 2].map((size) => (
                 <option key={size} value={size}>
                    {size}mm
                 </option>
                ))}
              {brand === "alpha" &&
                [4, 6, 8].map((size) => (
                 <option key={size} value={size}>
                    {size}mm
                 </option>
                ))}
            </select>
          </label>

          <label>
            Select Unit of Measure:
            <select onChange={(e) => setUnitOfMeasure(e.target.value)}>
              <option value="bag">Bag</option>
              <option value="kg">Kg</option>
            </select>
          </label>

          <label>
            Quantity:
            <input
              type="number"
              value={quantity}
              onChange={(e) => setQuantity(e.target.value)}
            />
          </label>

          <label>
            Unit Price:
            <input
              type="number"
              value={unitPrice}
              onChange={(e) => setUnitPrice(e.target.value)}
            />
          </label>

          <button onClick={calculateTotal}>Calculate Total</button>
        </form>
      </section>

      <section>
        <h2>Total Cost: {total} units</h2>
      </section>
    </div>
 );
};

export default CostCalculator;
